import NavBar from '../components/NavBar';
import '../styles/home.css';
import Logo from '../images/sample-logo.jpeg';

function Home() {
  const homeButtons = [
    'Planos Disponíveis',
    'Contato',
  ];

  return (
    <div>
      <header className="home-header">
        <img
          alt="Guilherme Castelo Branco Logo"
          className="img-logo"
          src={ Logo }
        />
      </header>
      <nav>

      </nav>
    </div>
  );
}

export default Home;
